# Criando dataframe com os atributos som a total
carreira_soma = carreira[atributos_soma].groupby('JOGADOR').sum()
# Criando o percentual de pontos por tipo de arremesso no DF carreira_soma
for percentual in percentual_pontos_list:
    carreira_soma[percentual+'_%'] = ((carreira_soma[percentual]  / carreira_soma['PTS']) * 100).round(2)

# Criando o Dataframe com os atributos que serão tratados pela média
carreira_media = carreira[atributos_media].groupby('JOGADOR').mean().round(2)

# Ajustando Dataframe com as colunas desejadas
carreira = pd.concat([carreira_soma, carreira_media], axis=1).groupby('JOGADOR')

# resetando index
carreira = carreira.agg('first').reset_index()

# Criando a coluna temporada
carreira['Temporada'] = 'Carreira'

# Criando a coluna origem
carreira['Origem'] = 'Carreira'

carreira['Temporadas_count'] = carreira['Temporadas_count'].astype(int)

