def plotar_grafico_barras(dataframe, atributo, titulo):
    dataframe = dataframe.drop_duplicates(subset=['JOGADOR'])
    pandas_data = dataframe.sort_values(atributo, ascending=True)

    # Criar uma figura e os eixos do gráfico
    fig, ax = plt.subplots(figsize=(4, 6))

    # Definir a posição inicial das barras
    posicao_y = range(len(pandas_data))

    # Plotar as barras horizontais
    ax.barh(posicao_y, pandas_data[atributo], align='center', color='#4682B4')

    # Percorrer os jogadores selecionados
    for i in posicao_y:
        jogador = pandas_data.iloc[i]['JOGADOR']
        if jogador in mvp_nba_endereco_imagem:
            # Carregar a imagem a partir do arquivo local
            img = mpimg.imread(mvp_nba_endereco_imagem[jogador])

            # Configurar a posição e tamanho da imagem
            imagebox = OffsetImage(img, zoom=0.1)
            ab = AnnotationBbox(imagebox, (pandas_data.iloc[i][atributo] + 0.2, i), frameon=False)
            ax.add_artist(ab)

            # Adicionar o valor do dado à esquerda da imagem com deslocamento
            ax.text(pandas_data.iloc[i][atributo] / 2, i, str(pandas_data.iloc[i][atributo]), ha='right', va='center_baseline', color='black',
                    bbox=dict(facecolor='gray', edgecolor='none', boxstyle='round'))

    # Configurar os limites do eixo X e Y
    ax.set_xlim(0, max(pandas_data[atributo]) * 1.1)
    ax.set_ylim(-0.5, len(pandas_data) - 0.5)

    # Configurar os rótulos do eixo Y
    ax.set_yticks(posicao_y)
    ax.set_yticklabels(pandas_data['JOGADOR'])

    # Configurar os rótulos dos eixos
    ax.set_xlabel(f'{atributo}')

    # Adicionar título ao gráfico
    plt.title(titulo, loc='left')

    # Definir a cor de fundo como cinza claro
    ax.set_facecolor('lightgray')
    fig.set_facecolor('lightgray')

    # Excluindo as linhas do topo e da direita
    ax.spines['top'].set_visible(False)
    ax.spines['right'].set_visible(False)

    # Salvando a figura com o nome do titulo
    fig.savefig(titulo, transparent=True, dpi=300, bbox_inches='tight')

    # Mostrar o gráfico
    plt.show()

